import React from 'react'

import {Grid, Box} from "@material-ui/core"
const Direccion = () => {
    return (
        <Grid item xs={12}>
            <Box
                border={1}
                borderRadius={2}
            >
                Esta es la direccion
            </Box>
        </Grid>
    )
}

export default Direccion;
